import React from "react";
import { Link } from 'react-router-dom';
import './Nav.css';

const Nav = () => {
    return (
        <nav className='headerNav'>
            <h1 id='header-title'>Notice Board System</h1>
            <Link to="/">HOME</Link>
            <Link to="/board/1">BOARD</Link>
            <Link to="/login">LOGIN</Link>
        </nav>
    );
};

export default Nav;
